  <script type="application/javascript">
    // wait until all the resources are loaded
    window.addEventListener("load", initialise, false);
    function initialise() {
      orsoncharts.pieDataset = new orsoncharts.KeyedValuesDataset();
      orsoncharts.pieDataset.data = pieChartData();
      orsoncharts.pieLabelGenerator = new orsoncharts.KeyedValueLabels();
      orsoncharts.pieLabelGenerator.valueDP = 0;
      orsoncharts.pieLabelGenerator.format = "{K} = NZ${V} million";
      orsoncharts.barDataset = new orsoncharts.KeyedValues3DDataset();
      orsoncharts.barDataset.data = barChartData();
      orsoncharts.barLabelGenerator = new orsoncharts.KeyedValue3DLabels();
      orsoncharts.barLabelGenerator.format = "{R}, {C} = US${V} billion";
      orsoncharts.scatterDataset = new orsoncharts.XYZDataset();
      orsoncharts.scatterDataset.data.series = scatterChartData();
      orsoncharts.scatterLabelGenerator = new orsoncharts.XYZLabels();
      orsoncharts.scatterLabelGenerator.format = "{S} = ({X}, {Y}, {Z})";
      var pieSVG = document.getElementById("PieChart1");
      pieSVG.onmouseover = handleMouseOver;
      pieSVG.onclick = handleClick;
      var barSVG = document.getElementById("BarChart1");
      barSVG.onmouseover = handleMouseOver;
      barSVG.onclick = handleClick;
      var scatterSVG = document.getElementById("ScatterChart1");
      scatterSVG.onmouseover = handleMouseOver;
      scatterSVG.onclick = handleClick;
    }
    function handleClick(evt) {
      var element = evt.target;
      var ref = orsoncharts.Utils.findChartRef(element);
      var chartId = orsoncharts.Utils.findChartId(element);
      alert('You clicked on the item ' + ref + ' for the chart [' + chartId + ']');
    }
    function handleMouseOver(evt) {
      var element = evt.target;
      var ref = orsoncharts.Utils.findChartRef(element);
      var content;
      var chartId = orsoncharts.Utils.findChartId(element);
      if (ref != null && ref != 'ORSON_CHART_TOP_LEVEL') {
        var refObj = JSON.parse(ref);
        if (Opentip.tips.length < 1) {
          myOpentip = new Opentip(element, "content");
        } else {
          myOpentip = Opentip.tips[0];
        }
        myOpentip.target = element;
        if (chartId == "PieChart1") {
          if (refObj.hasOwnProperty("key")) {
             var itemIndex = orsoncharts.pieDataset.indexOf(refObj.key);
             content = orsoncharts.pieLabelGenerator.itemLabel(orsoncharts.pieDataset, itemIndex);
          } else { content = ref; }
        } else if (chartId == "BarChart1") {
          if (!refObj.hasOwnProperty("type")) {
            var seriesIndex = orsoncharts.barDataset.seriesIndex(refObj.seriesKey);
            var rowIndex = orsoncharts.barDataset.rowIndex(refObj.rowKey);
            var columnIndex = orsoncharts.barDataset.columnIndex(refObj.columnKey);
            content = orsoncharts.barLabelGenerator.itemLabel(orsoncharts.barDataset, seriesIndex, rowIndex, columnIndex);
          } else {
          content = ref + " for bar chart.";
          }
        } else if (chartId == "ScatterChart1") {
          if (!refObj.hasOwnProperty("type")) {
            content = orsoncharts.scatterLabelGenerator.itemLabel(orsoncharts.scatterDataset, refObj.seriesKey, refObj.itemIndex);
          } else {
            content = ref + " for scatter plot.";
          }
        }
        myOpentip.setContent(content);
        myOpentip.reposition();
        myOpentip.show();
      }
    }
</script>
